Dirty Weekenders in France

Travel Documentary hosted by Richard E Grant, published by Channel 4 in 2014 - English narration


Information
------------------------------

Self-confessed curio hunter Richard E. Grant takes a trip to the continent to reveal the world of the people who spend their time rifling through the barns, cowsheds and French farm attics, looking for pre-war treasures to bring back home. The show explores the world of professional antique hunters and dealers who seek out hidden treasures at flea markets and antique shops all over France; hoping to find curios like absinthe glasses, horse linen and vintage traffic lights that will sell like wildfire in the UK. Richard and two dealers storm the continent to plunder its treasures and discover the stories behind their amazing vintage finds, as well as the history and culture of the areas they visit. But can they recover their outlay in a weekend? And as Richard revels in the land of dusty cafes, beautiful B&amp;Bs and the perfect citron pressÃƒÂ©, can these dealers actually make a living from their weekend of treasure hunting?

